import {Menu} from 'semantic-ui-react';
import Link from 'next/link';

export default (props) => 
<div className="App">
    <header>
        <h1>Layout Menu</h1>
        <Menu pointing secondary>
            <Menu.Item  as={Link} name='home' href="/" />
            <Menu.Item  as={Link} name='about' href="/about" />
        </Menu>
    </header>
    {props.children}
    <style jsx>{`
        h1 {
            border-bottom: 1px solid gray;
        }
    `}
    </style>
</div>
